import PropTypes from "prop-types";

const CardInfo = ({ className = "" }) => {
  return (
    <button
      className={`cursor-pointer [border:none] py-[5px] px-[15px] bg-[#dbdbdb] rounded-[8px] flex flex-row items-start justify-start gap-[16px] z-[2] ${className}`}
    >
      <img
        className="h-[32px] w-[32px] relative overflow-hidden shrink-0 hidden"
        alt=""
        src="vince-image.jpg"
      />
      <div className="flex flex-row items-start justify-start">
        <div className="w-[64px] relative text-[14px] font-[Roboto] text-[#4f6068] text-center hidden">
          Add Items
        </div>
        <div className="relative text-[20px] font-[Roboto] text-[#343b3f] text-left inline-block min-w-[96px] mq450:text-[16px]">
          Edit Profile
        </div>
      </div>
    </button>
  );
};

CardInfo.propTypes = {
  className: PropTypes.string,
};

export default CardInfo;
